import React from "react";
import { Link } from "react-router-dom";
import './style.css'

const Header = () =>{
    return(
        <>
        <div>
         <header className="header">
          <h3 className="headerx primary "><Link to="/">PT.</Link></h3>
             <nav className="navbar">
               <ul className="list secondary">
               <Link className="navl secondary" to="/Project">Project</Link>
               <Link className="navl secondary" to ="/Skill">Skill</Link>
               <Link className="navl" to="/contact">Contact</Link>
               </ul>
               
             </nav>
         </header>
         </div>   
        </>
    );
}

export default Header;
